(79, '2016-12-14', '', 'Mantenimiento de paredes de la tina de contacto en la PTAR\r\nEstación elevadora ', 'Finalizada', 'Pintura Epóxica - Concreto Expuesto.\r\n-La línea de inyección de cloro necesita limpieza o reemplazo esta carbonatada, sale de color blanco típico de la adsorción de CO2 (g).\r\n\r\n-Requiere más limpieza del pozo- Durante la inspección vi a un solo hombre laborando en la zona.\r\n\r\n-La estación elevadora de custodios requiere mantenimiento (limpieza) y un checking electromecánico al parecer hay un reset persistente en el equipo.\r\n\r\n-La Bomba de Inyección de Cloro necesita mantenimiento.\r\n\r\n- Mejorar en la la recolección desechos y herramientas de trabajo (guantes , coladores).\r\n\r\nMaxia Comentario: La planta en general esta en mantenimiento preventivo (pintura)\r\n- Mantenimiento de la estación elevadora 1 - limpieza - finalizada\r\n- Tina de secado pintura - finalizada\r\n- Modulos 1 y 2 pintura finalizada\r\n- Mantenimiento preventivo de la Bomba inyección de cloro - Finalizada\r\n- Mantenimiento de la cámara de contacto de cloro  - Finalizada\r\n', 'Correctivo', 0, 'Otros', 'PTAR', 0, 'SERVICIO - 01: OPERACIÓN DE EQUIPOS ESPECIALES', '', 'agarcia ', '2016-12-14 00:00:00', 'cbethancourt'),
