(85, '2016-12-16', '', 'Falla de Aire Acondicionado -Portal Principal\r\n\r\nPlanta Baja ', 'Finalizada', 'Falla de Aire Acondicionado tipo Split de 24 KBTU, no enfría bien.\r\n\r\nMAXIA COMENTARIO:\r\nLA FALLA DEL AIRE, NO ES EN PLANTA BAJA, ES EN PLANTA ALTA EN LAS OFICINAS DE ADMINISTRACION DONDE  EL AIRE\r\n  NO ESTABA ENFRIANDO YA QUE LOS TERMOSTATOS LOS MODIFICARON , SUBIENDO LA TEMPERATURA, ES DECIR, NORMALMENTE ESTO EQUIPOS DEBEN TRABAJAR EN UN RANGO DE 60 oF A 70 oF  Y ESTE SE ENCONTRABAN UNO  A 80 oF EL CUAL SE AJUSTO AL RANGO ESTABLECIDO. EL DIA 20-12-2016 SE VERIFICO LA TEMPERATURA DEL AREA ADMINISTRATIVA Y CAMARA Y LA TEMPERATURA ESTA EN OPTIMAS CONDICIONES. ESTOS TERMOSTATOS ESTAN UBICADOS AL LADO DEL CUARTO DE CAMARA EN EL PORTAL PRINCIPAL EN EL EDIFICIO ADMINISTRATIVO.', 'Correctivo', 0, 'Administracion', 'Otros', 0, 'SERVICIO - 03: MANTENIMIENTO DE ACTIVOS (PREVENTIVOS & CORRECTIVOS)', '', 'maplosa', '2016-12-16 00:00:00', 'cbethancourt'),
