(128, '2017-01-10', '', 'Fallas de Aires Acondicionados ', 'Finalizada', 'Buenas tardes, es para reportar daños de los siguientes equipos:\r\n\r\n1. Monitoreo de los  Sectores :  B / D / E. \r\n\r\n2. Monitores del área Principal.\r\n\r\n3.  Educación Norte, Sector A/ Cuarto Técnico Cámaras\r\n\r\nReporte Suministrado por Delta América Valdés  \r\n\r\nMAXIA RESPONDE: \r\n\r\nCUARTOS DE MONITOREO O CAMARA B, D : ARREGLADO\r\n\r\nCUARTO DE MONITOREO EN EL SECTOR E: ESTA OPERATIVO, EL PROBLEMA ESTA EN EL CUARTO O SALA DE PROFESORES EL EQUIPO ESTA QUEMADO, EL COMPRESOR. NO ARRANCA. ESTO SE DEBE COMO EN EL SECTOR A LOS EQUIPOS SE QUEDAN ENCENDIDOS LAS PUERTAS ABIERTAS NO REALIZAN SU CICLO, EL EQUIPO SE FORZA 24 HORAS ENCENDIDO. A LA TEMPERATURA DE ENFRIAMIENTO MAS BAJA. LAS TARJETAS SE RECALIENTAN Y SE QUEMA LA UNIDAD.\r\n      \r\nLAS UNIDADES DE AIRE DEL SECTOR A, EN CUARTO DE CAMARAS, ESTAN TRABAJANDO BIEN, SE ENCONTRO EL AIRE DE PROFESORES EN ESTA AREA  ENCENDIDO Y NO SE ESTABA UTILIZANDO. \r\n', 'Correctivo', 0, 'Otros', 'Otros', 0, 'SERVICIO - 03: MANTENIMIENTO DE ACTIVOS (PREVENTIVOS & CORRECTIVOS)', '', 'maplosa', '2017-01-10 00:00:00', 'aarosemena'),
