(184, '2017-01-30', 'SISTEMA DE AIRES ACONDICIONADOS ', 'Solicitan el mantenimiento de los aires acondicionados ubicados en el área de cámaras del Sector E y en la entrada del taller de producción. \r\n\r\nMaxia Comentario: Se verifico el aire y salió como diagnostico que el compresor esta quemado. Esto se debe ha que estando dejando las puerta abierta de las esclusas lo cual la unidad no descansada y trabaja forzado ocasionando lo anterior dicho.', 'Finalizada', 'Solicitado pro la Licda. Linda Moreira, subdirectora del Sector E', 'Correctivo', 0, 'Sector E', 'Otros', 0, 'SERVICIO - 03: MANTENIMIENTO DE ACTIVOS (PREVENTIVOS & CORRECTIVOS)', 'AIRES ACONDICIONADOS - MINISPLIT', 'maplosa', '2017-02-04 18:50:17', 'dmedinad'),
(185, '2017-01-27', 'SISTEMAS DE VAPOR Y GAS ', 'Se realizo inspección al área de la cocina en general y encontramos que los privados de libertad están utilizando los equipos, lo que ha ocasionado que los mismos estén dañados, golpeados. \r\nAdicional la empresa conalipa a realizado adecuaciones en estas áreas.', 'Finalizada', '', 'Correctivo', 0, 'Sector D', 'Cocina', 0, 'SERVICIO - 03: MANTENIMIENTO DE ACTIVOS (PREVENTIVOS & CORRECTIVOS)', '', '', '2017-01-27 00:00:00', 'nserracin'),
