(268, '2017-03-28', 'SISTEMAS DE VAPOR Y GAS ', '-Se reporto que una marmita de la cocina del sector a se había inflado en la parte interna de la misma. Procedí a realizar la inspección y pude observar que si estaba inflada una parte en el interior de la marmita. Cuando sucede esto casi siempre lo causa la falta de agua en el interior de la misma marmita.  Esta agua tiene que llenarse abriendo la llave con la cual tu llenas a la cantidad necesaria de igual manera el vapor de la misma.\r\nEl personal de CONALIPA encargado me comento que la encontro en ese estado. \r\nSolicito que el encargado del contrato de CONALIPA venga a realizar la revisión. \r\n', 'Finalizada', '', 'Correctivo', 0, 'Sector A', 'Cocina', 0, 'SERVICIO - 01: OPERACIÓN DE EQUIPOS ESPECIALES', 'Verificación de Operación de las CALDERAS', 'vmontenegro', '2017-03-28 00:00:00', 'jpvasquez'),
