(11439, '2017-04-01 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'RECOLECCIÓN PRENDAS: Los PL´S Recogen la vestimenta en el pabellón indicado utilizando formato de recolección y entrega de prendas, diseñado para identificar a quien le pertenece cada prenda de vestir entregada a los operadores de la lavandería, se traslada al área de lavandería para luego marcarlas/ identificarlas.MARCADO PRENDAS: Los PL´S Marcan la vestimenta con elementos resistentes al agua y calor.', 'Preventiva', 'Sabados', 'Operación de RECOLECCIÓN Y ENTREGA de PRENDAS (Privados de Libertad y Cama)', 46, 'Operación en la RECOLECCION, MARCADO y ENTREGA OPORTUNA de PRENDAS (Privados de Libertad y de Cama) - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-01 10:27:00', 0),
(11440, '2017-04-01 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'CLASIFICACIÓN - LAVADO PRENDAS: Los PL´S clasifican las  prendas de vestir por color y se disponen en las lavadoras, Cada lavadora se carga según la capacidad, 110lb ó 50lb.SECADO:Después de cumplir con el ciclo de lavado los PL´S movilizan la ropa a las secadoras y se cargan las maquinas dependiendo de la capacidad, 110 lb ó 50lb.', 'Preventiva', 'Sabados', 'Operación en LAVADO Y SECADO de PRENDAS (Privados de Libertad y de Cama)', 47, 'Operación en LAVADO y SECADO de PRENDAS (Privados de Libertad y de Cama) - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-01 10:29:31', 0),
(11441, '2017-04-01 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'PLANCHADO: Los PL´S proceden al planchado de las prendas luego de culminar el tiempo de secado.', 'Preventiva', 'Sabados', 'Operación en PLANCHADO de PRENDAS (Privados de Libertad y de Cama)', 48, 'Operación en PLANCHADO de PRENDAS (Privados de Libertad y de Cama) - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-01 10:29:50', 0),
