(11560, '2017-04-08 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'RECOLECCIÓN PRENDAS: Los PL´S Recogen la vestimenta en el pabellón indicado utilizando formato de recolección y entrega de prendas, diseñado para identificar a quien le pertenece cada prenda de vestir entregada a los operadores de la lavandería, se traslada al área de lavandería para luego marcarlas/ identificarlas.MARCADO PRENDAS: Los PL´S Marcan la vestimenta con elementos resistentes al agua y calor.', 'Preventiva', 'Sabados', 'Operación de RECOLECCIÓN Y ENTREGA de PRENDAS (Privados de Libertad y Cama)', 46, 'Operación en la RECOLECCION, MARCADO y ENTREGA OPORTUNA de PRENDAS (Privados de Libertad y de Cama) - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-10 08:11:18', 0),
(11561, '2017-04-08 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'CLASIFICACIÓN - LAVADO PRENDAS: Los PL´S clasifican las  prendas de vestir por color y se disponen en las lavadoras, Cada lavadora se carga según la capacidad, 110lb ó 50lb.SECADO:Después de cumplir con el ciclo de lavado los PL´S movilizan la ropa a las secadoras y se cargan las maquinas dependiendo de la capacidad, 110 lb ó 50lb.', 'Preventiva', 'Sabados', 'Operación en LAVADO Y SECADO de PRENDAS (Privados de Libertad y de Cama)', 47, 'Operación en LAVADO y SECADO de PRENDAS (Privados de Libertad y de Cama) - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-10 08:12:05', 0),
(11562, '2017-04-08 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'PLANCHADO: Los PL´S proceden al planchado de las prendas luego de culminar el tiempo de secado.', 'Preventiva', 'Sabados', 'Operación en PLANCHADO de PRENDAS (Privados de Libertad y de Cama)', 48, 'Operación en PLANCHADO de PRENDAS (Privados de Libertad y de Cama) - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-10 08:12:59', 0),
(11563, '2017-04-08 00:00:00', 'SERVICIO DE LAVANDERIA', 'cbethancourt', 'Finalizada', 'LOS INSUMOS SON ENTREGADOS DIARIAMENTE POR EL SUPERVISOR: 1 DALON DE CLOR, 1 GALON DE JABON LIQUIDO, GUANTES DESECHABLES, MASCARILLAS.', 'Preventiva', 'Sabados', 'Suministro de INSUMOS DE OPERACIÓN en LAVANDERIAS', 49, 'Suministro de INSUMOS DE OPERACIÓN en LAVANDERIAS - Otros - Otros', 'SERVICIO - 02: SERVICIO DE LAVANDERIA', '2017-04-10 08:15:15', 0),
(11564, '2017-04-08 00:00:00', 'LIMPIEZA, ASEO Y CONTROL DE PLAGAS', 'cbethancourt', 'Finalizada', 'El Proveedor Fumigaciones Cancún hace la Fumigación contra Garrapatas en el area de Caniles en la parte trasera delantera y dentro del Edificio.El Proveedor Fumigaciones Cancún hace la Fumigación  en el Sector A  Mediana 01,02,03 Area Sur parte trasera y delantera de los pabellones contra insectos voladores (AEDES AEGYPTI) .El Proveedor Fumigaciones Cancún hace la Fumigación  en el Sector B Mediana 01,02,03 Area Sur Maxima 01,Extrema, Maxima 02 Area Norte parte trasera y delantera de los pabellones contra insectos voladores (AEDES AEGYPTI) El Proveedor Fumigaciones Cancún hace la Fumigación  en el  Area De Portal Principal(GARITA) Clasificación, Via Atención Visitas, Via Custodio, contra Arrieras.', 'Preventiva', 'Sabados', 'sinFormulario', 50, 'Control de Plagas - Otros - Otros', 'SERVICIO - 03: MANTENIMIENTO DE ACTIVOS (PREVENTIVOS & CORRECTIVOS)', '2017-04-10 08:19:18', 0),
