(11575, '2017-04-08 00:00:00', 'MANTENIMIENTO DE INFRAESTRUCTURA EDIFICACIONES', 'cbethancourt,wrodriguez', 'Finalizada', 'Revisión de todos los paneles de incendio y cambio de dispositivos.-Lunes 3 de abril del 2017 sector A.-Martes 4 de abril del 2017 sector B.-Miercoles 5 del abril del 2017 sector C.-Jueves 6 de abril del 2017 sector D.-Viernes 7 de abril del 2017 sector E-Sabado 8 de abril del 2017 Administración y custodios.Felix Martinez INGENS: Se realizo el mantenimiento correctivo de los paneles dejando los paneles en cero problema de los sectores de CUSTODIO, PORTAL, D, E, en el sector E se realizo un cambio de una fuente del poder del panel ya que no cargaba la bateria se realizo el cambio al instante ya que vimos ese problema.También se les comunica que estamos trabajando en el mantenimiento correctivo en en los sectores A,B,C  para luego pasar dar el mantenimiento preventivo de este mes que son los sectores D,E.', 'Preventiva', 'Sabados-4', 'Inspección - Verificación - 11. PARARRAYOS', 119, '3 - Inspección y verificación de: Panel de Incendios (Detectores), Rociadores - Otros - Saneamiento', 'SERVICIO - 03: MANTENIMIENTO DE ACTIVOS (PREVENTIVOS & CORRECTIVOS)', '2017-04-22 10:34:40', 0),
