when "MANTENIMIENTO DE INFRAESTRUCTURA EDIFICACIONES"	then return   "INFRAESTRUCTURA";
when "MANTENIMIENTO DE INFRAESTRUCTURA URBANISMO" then return   "INFRAESTRUCTURA";
ELSE
   return "";
end case$$

